import React from "react";
import Link from 'react-router-dom'

const DUMMY_DATA = [
  {
    id: e1,
    title: "some-event",
  },
  {
    id: e2,
    title: "some-event",
  },
  {
    id: e3,
    title: "some-event",
  },
  {
    id: e4,
    title: "some-event",
  },
];

export const Events = () => {
  return (
    <>
      <h1>EventsPage</h1>
      <ul>
        {DUMMY_DATA.map(event => <Link><li>{event.title}</li></Link>)}
      </ul>
    </>
  );
};
